import React, { useState } from "react"
import validate from './../validation/validateFunction'
import './../css/chat.css'





function Profile(props) {
console.log('sssss',props)
const[field, setField] = useState({
    firstName:'name',
    lastName:'lastname',
    email:'z@k.com',
    profilePic:''
    }
);

const[error,setError] = useState({
    firstName:'name',
    lastName:'lastname',
    email: validate('email'),
    profilePic:''
})
return(
    <div className="profile">
        firstName:
        <input 
        type="text"
        name="email"
        onChange={(e) => setField(e.target.value)}
        />
        <p> {field.firstName} </p>
        lastName:
        <input
        type="text"
        name="lastName"
        onChange={(e) => setField(e.target.value)}
        />
        <p> {field.lastName} </p>
        <input
        type="text"
        name="email"
        onChange={(e) => setField(e.target.value)}
        />
        <p>{field.email}</p>
        <input
         type="submit"
         value="click" 
         onClick={error}
         />
    </div>

    );
}
export default Profile
